import React from 'react';
// import { useContext } from 'react';
import { Routes, Route } from 'react-router-dom';
// import AuthContext from './store/auth-context';
import Signup from './components/Registration/SignUp';
import ForgetPass from './components/Forget/ForgetPass';
import UserProfile from './components/Profile/UserProfile';
import SignIn from './components/Login/SignIn';
import CameraView from '../Layout/Camera-view';
import RealtimeDisplay from '../Layout/Real-time-Display';
import Account from '../Layout/Account';
import RecordAnalysis from '../Layout/Record-analysis';


function App() {
  // const authCtx = useContext(AuthContext);
  return (

      <Routes>

            <Route path="/" element={<SignIn />} /> 





        <Route path="/Signup" element={<Signup />} />
        <Route path="/Forget" element={<ForgetPass />} />

          <Route path="/Profile/*" element={<UserProfile/>} />

          <Route path="/record-analysis" element={<RecordAnalysis />} /> 

        <Route path="camera-view" element={<CameraView />} />



        <Route path="/Account" element={<Account />} />
        <Route path="/real-time-Display" element={<RealtimeDisplay />} />


      </Routes>




  );
}

export default App;
